INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "カリン", 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 60000, 1, 190804, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 1, 60000, 2, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, 60000, 3, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 1, 60000, 4, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 2, 60000, 5, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 2, 60000, 6, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2, 60000, 7, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 3, 60000, 8, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 3, 60000, 9, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 3, 60000, 10, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 3, 60000, 11, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 3, 60000, 12, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 4, 60000, 13, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 4, 60000, 14, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 4, 60000, 15, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 4, 60000, 16, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 4, 60000, 17, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 2, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 60000, 18, 190804, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "カリン", 3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, 60000, 19, 190804, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "ハツネ", 1, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 0, 80001, 20, 101201, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "ハツネ", 2, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 0, 80001, 21, 101201, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "シオリ", 1, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 0, 80001, 22, 103801, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "シオリ", 2, "来年も、\n一緒にいられたら…\nうれしいな", 0, 80001, 23, 103801, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "キョウカ", 1, "あなたと一緒にいるようになって、\nもう1年ですか…", 0, 80001, 24, 103601, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "キョウカ", 2, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 0, 80001, 25, 103601, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "ミミ", 1, "おにいちゃんとあってから、\n1年たったよ～！", 0, 80001, 26, 102001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "ミミ", 2, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 0, 80001, 27, 102001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "ミソギ", 1, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 0, 80001, 28, 100401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "ミソギ", 2, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 0, 80001, 29, 100401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "マホ", 1, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 0, 80001, 30, 101001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "マホ", 2, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 0, 80001, 31, 101001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "イリヤ", 1, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 0, 80001, 32, 104401, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "イリヤ", 2, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 0, 80001, 33, 104401, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "カオリ", 1, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 0, 80001, 34, 101701, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "カオリ", 2, "これからも、どうぞよろしく\nお願いするさ～！", 0, 80001, 35, 101701, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "サレン", 1, "あんたと出会ってからもうそんなに\nたつのね～", 0, 80001, 36, 102801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "サレン", 2, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 0, 80001, 37, 102801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "スズメ", 1, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 0, 80001, 38, 102501, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "スズメ", 2, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 0, 80001, 39, 102501, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "タマキ", 1, "振り返れば、今までいろんなことが\nあったにゃあ…", 0, 80001, 40, 104601, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "タマキ", 2, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 0, 80001, 41, 104601, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "ミフユ", 1, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 0, 80001, 42, 104801, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "ミフユ", 2, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 0, 80001, 43, 104801, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "アキノ", 1, "あなたさまと出会ってもう1年…", 0, 80001, 44, 103201, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "アキノ", 2, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 0, 80001, 45, 103201, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "ユカリ", 1, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 0, 80001, 46, 103401, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "ユカリ", 2, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 0, 80001, 47, 103401, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "クリスティーナ", 1, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 0, 80001, 48, 107101, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "クリスティーナ", 2, "ともかくこれからも\n愉しませてくれよ☆", 0, 80001, 49, 107101, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "ジュン", 1, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 0, 80001, 50, 104701, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "ジュン", 2, "見えないから分からないって？\nそれもそうだな…", 0, 80001, 51, 104701, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "トモ", 1, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 0, 80001, 52, 103701, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "トモ", 2, "これからもよろしくね！", 0, 80001, 53, 103701, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "マツリ", 1, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 0, 80001, 54, 100501, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "マツリ", 2, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 0, 80001, 55, 100501, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "ミヤコ", 1, "オマエと会って1年なの！\n全然成仏もできなかったし、", 0, 80001, 56, 100701, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "ミヤコ", 2, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 0, 80001, 57, 100701, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "シノブ", 1, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 0, 80001, 58, 103101, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "シノブ", 2, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 0, 80001, 59, 103101, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "アンナ", 1, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 0, 80001, 60, 100901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "アンナ", 2, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 0, 80001, 61, 100901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "ナナカ", 1, "君と出会ってもう1年だって！\n早いねー！", 0, 80001, 62, 101301, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "ナナカ", 2, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 0, 80001, 63, 101301, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "ミツキ", 1, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 0, 80001, 64, 105101, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "ミツキ", 2, "これからも、いろんなところを\n調べさせてね？", 0, 80001, 65, 105101, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "ルカ", 1, "お前さんと出会ってもう1年か\n助太刀するつもりが", 0, 80001, 66, 105601, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "ルカ", 2, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 0, 80001, 67, 105601, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "エリコ", 1, "早いものですわね、あなた様と\nお会いして、もう1年…", 0, 80001, 68, 102701, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "エリコ", 2, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 0, 80001, 69, 102701, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "アヤネ", 1, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 0, 80001, 70, 102301, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "アヤネ", 2, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 0, 80001, 71, 102301, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "チカ", 1, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 0, 80001, 72, 104201, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "チカ", 2, "私のことを見守ってください\nできることなら、ずっと…", 0, 80001, 73, 104201, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "クルミ", 1, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 0, 80001, 74, 102101, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "クルミ", 2, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 0, 80001, 75, 102101, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "シズル", 1, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 0, 80001, 76, 104901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "シズル", 2, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 0, 80001, 77, 104901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "リノ", 1, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 0, 80001, 78, 101101, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "リノ", 2, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 0, 80001, 79, 101101, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "ユイ", 1, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 0, 80001, 80, 100201, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "ユイ", 2, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 0, 80001, 81, 100201, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "ヒヨリ", 1, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 0, 80001, 82, 100101, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "ヒヨリ", 2, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 0, 80001, 83, 100101, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "レイ", 1, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 0, 80001, 84, 100301, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "レイ", 2, "キミに背中を預けられる日が、\n早くきますように", 0, 80001, 85, 100301, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "ペコリーヌ", 1, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 0, 80001, 86, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "ペコリーヌ", 2, "これからもずっと、覚えていて\nくださいね！", 0, 80001, 87, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "コッコロ", 1, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 0, 80001, 88, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "コッコロ", 2, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 0, 80001, 89, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "キャル", 1, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 0, 80001, 90, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "キャル", 2, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 0, 80001, 91, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "スズメ", 1, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 0, 60001, 92, 112101, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 1, 60001, 93, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, 60001, 94, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 1, 60001, 95, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 1, 60001, 96, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 1, 60001, 97, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 2, 60001, 98, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 2, 60001, 99, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 2, 60001, 100, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 2, 60001, 101, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2, 60001, 102, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 3, 60001, 103, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 3, 60001, 104, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 3, 60001, 105, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 3, 60001, 106, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 3, 60001, 107, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 3, 60001, 108, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 3, 60001, 109, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 4, 60001, 110, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 4, 60001, 111, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 4, 60001, 112, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 4, 60001, 113, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 4, 60001, 114, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 4, 60001, 115, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 4, 60001, 116, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "スズメ", 2, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 0, 60001, 117, 112101, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "スズメ", 3, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 0, 60001, 118, 112101, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "ペコリーヌ", 1, "ヒューヒュー♪\nドンドンパフパフー♪", 0, 80003, 119, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "コッコロ", 1, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 0, 80003, 120, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "コッコロ", 2, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 0, 80003, 121, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "キャル", 1, "え？　ちょっと\nいきなりなにっ？", 0, 80003, 122, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "キャル", 2, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 0, 80003, 123, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "ペコリーヌ", 2, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 0, 80003, 124, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "ペコリーヌ", 3, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 0, 80003, 125, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "コッコロ", 3, "ですからその日に向けて\n今から気分を盛り上げているのです", 0, 80003, 126, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "キャル", 3, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 0, 80003, 127, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "コッコロ", 4, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 0, 80003, 128, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "ペコリーヌ", 4, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 0, 80003, 129, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "キャル", 4, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 0, 80003, 130, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "コッコロ", 5, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 0, 80003, 131, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "キャル", 5, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 0, 80003, 132, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "カリン", 1, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 0, 80003, 133, 190801, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "キャル", 6, "げっ…カリンじゃない\nなんでもないわよ！", 0, 80003, 134, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "カリン", 2, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 0, 80003, 135, 190801, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "キャル", 7, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 0, 80003, 136, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "カリン", 3, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 0, 80003, 137, 190801, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "キャル", 8, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 0, 80003, 138, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "キャル", 9, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 0, 80003, 139, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "カリン", 4, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 0, 80003, 140, 190801, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "キャル", 10, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 0, 80003, 141, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "カリン", 5, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 0, 80003, 142, 190801, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "キャル", 11, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 0, 80003, 143, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "コッコロ", 6, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 0, 80003, 144, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "ペコリーヌ", 5, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 0, 80003, 145, 105801, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "コッコロ", 7, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 0, 80003, 146, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "コッコロ", 8, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 0, 80003, 147, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "ペコリーヌ", 6, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 0, 80003, 148, 105801, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "ペコリーヌ", 7, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 0, 80003, 149, 105801, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "コッコロ", 9, "あとは、牧場に素敵な温泉が\n出来たとか…", 0, 80003, 150, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "ペコリーヌ", 8, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 0, 80003, 151, 105801, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "コッコロ", 10, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 0, 80003, 152, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "ペコリーヌ", 9, "えへへ、ありがとうございます\nコッコロちゃん！", 0, 80003, 153, 105801, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "コッコロ", 11, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 0, 80003, 154, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "ペコリーヌ", 10, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 0, 80003, 155, 105801, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "ペコリーヌ", 11, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 0, 80003, 156, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "キャル", 12, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 0, 80003, 157, 106001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "ペコリーヌ", 12, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 0, 80003, 158, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "キャル", 13, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 0, 80003, 159, 106001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "ペコリーヌ", 13, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 0, 80003, 160, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "キャル", 14, "…積極的？\nなんの話よ？", 0, 80003, 161, 106001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "ペコリーヌ", 14, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 0, 80003, 162, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "ペコリーヌ", 15, "ムーサの町で\nきゃるきゃる～ん☆　って！", 0, 80003, 163, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "キャル", 15, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 0, 80003, 164, 106001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "ペコリーヌ", 16, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 0, 80003, 165, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "キャル", 16, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 0, 80003, 166, 106001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "キャル", 17, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 0, 80003, 167, 106001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "キャル", 18, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 0, 80003, 168, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "コッコロ", 12, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 0, 80003, 169, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "キャル", 19, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 0, 80003, 170, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "コッコロ", 13, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 0, 80003, 171, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "キャル", 20, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 0, 80003, 172, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "コッコロ", 14, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 0, 80003, 173, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "キャル", 21, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 0, 80003, 174, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "コッコロ", 15, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 0, 80003, 175, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "キャル", 22, "かくし芸？", 0, 80003, 176, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "コッコロ", 16, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 0, 80003, 177, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "キャル", 23, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 0, 80003, 178, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "ペコリーヌ", 17, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 0, 80003, 179, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "キャル", 24, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 0, 80003, 180, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "コッコロ", 17, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 0, 80003, 181, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "ペコリーヌ", 18, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 0, 80003, 182, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "キャル", 25, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 0, 80003, 183, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "コッコロ", 18, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 0, 80003, 184, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "キャル", 26, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 0, 80003, 185, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "キャル", 27, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 0, 80003, 186, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "キャル", 28, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 0, 80003, 187, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "ペコリーヌ", 19, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 0, 80003, 188, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "コッコロ", 19, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 0, 80003, 189, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "キャル", 29, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 0, 80003, 190, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "キャル", 30, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 0, 80003, 191, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "キャル", 31, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 0, 80003, 192, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "キャル", 32, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 0, 80003, 193, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "キャル", 33, "あー\nあー\n…声、これで大丈夫かしら？", 0, 80003, 194, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "キャル", 34, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 0, 80003, 195, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "キャル", 35, "オイッスー☆", 0, 80003, 196, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "キャル", 36, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 0, 80003, 197, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "キャル", 37, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 0, 80003, 198, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "キャル", 38, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 0, 80003, 199, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "コッコロ", 20, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 0, 80003, 200, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "コッコロ", 21, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 0, 80003, 201, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "コッコロ", 22, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 0, 80003, 202, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "コッコロ", 23, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 0, 80003, 203, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "コッコロ", 24, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 0, 80003, 204, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "コッコロ", 25, "オイッスー☆", 0, 80003, 205, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "コッコロ", 26, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 0, 80003, 206, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "コッコロ", 27, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 0, 80003, 207, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "コッコロ", 28, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 0, 80003, 208, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "ペコリーヌ", 20, "オイッスー☆", 0, 80003, 209, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "ペコリーヌ", 21, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 0, 80003, 210, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "ペコリーヌ", 22, "あと６日で2.5周年ですか…", 0, 80003, 211, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "ペコリーヌ", 23, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 0, 80003, 212, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "ペコリーヌ", 24, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 0, 80003, 213, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "ペコリーヌ", 25, "オイッスー☆", 0, 80003, 214, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "ペコリーヌ", 26, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 0, 80003, 215, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "ペコリーヌ", 27, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 0, 80003, 216, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "ペコリーヌ", 28, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 0, 80003, 217, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "ペコリーヌ", 29, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 0, 80003, 218, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "ペコリーヌ", 30, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 0, 80003, 219, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "ペコリーヌ", 31, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 0, 80003, 220, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "コッコロ", 29, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 0, 80003, 221, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "ペコリーヌ", 32, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 0, 80003, 222, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "キャル", 39, "…………", 0, 80003, 223, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "コッコロ", 30, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 0, 80003, 224, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "キャル", 40, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 0, 80003, 225, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "ペコリーヌ", 33, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 0, 80003, 226, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "キャル", 41, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 0, 80003, 227, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "ペコリーヌ", 34, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 0, 80003, 228, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "ペコリーヌ", 35, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 0, 80003, 229, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "キャル", 42, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 0, 80003, 230, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "コッコロ", 31, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 0, 80003, 231, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "キャル", 43, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 0, 80003, 232, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "ペコリーヌ", 36, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 0, 80003, 233, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "カリン", 6, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 0, 80003, 234, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "カリン", 7, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 0, 80003, 235, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "カリン", 8, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 0, 80003, 236, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "カリン", 9, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 0, 80003, 237, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "カリン", 10, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 0, 80003, 238, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "カリン", 11, "次にコッコロさんですが\nこちらは発声練習をしています", 0, 80003, 239, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "カリン", 12, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 0, 80003, 240, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "カリン", 13, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 0, 80003, 241, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "カリン", 14, "あれ？\nもしかして緊張で気を失って…？", 0, 80003, 242, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "カリン", 15, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 0, 80003, 243, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "カリン", 16, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 0, 80003, 244, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "カリン", 17, "それでは\nまた明日お会いしましょう♪", 0, 80003, 245, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "キャル", 44, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 0, 80003, 246, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "ペコリーヌ", 37, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 0, 80003, 247, 105801, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "コッコロ", 32, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 0, 80003, 248, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "キャル", 45, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 0, 80003, 249, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "ペコリーヌ", 38, "ひどいですよぉキャルちゃ～ん！", 0, 80003, 250, 105801, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "コッコロ", 33, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 0, 80003, 251, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "ペコリーヌ", 39, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 0, 80003, 252, 105801, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "キャル", 46, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 0, 80003, 253, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "コッコロ", 34, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 0, 80003, 254, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "ペコリーヌ", 40, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 0, 80003, 255, 105801, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "ペコリーヌ", 41, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 0, 80003, 256, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "キャル", 47, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 0, 80003, 257, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "ペコリーヌ", 42, "忘れてきちゃいました☆", 0, 80003, 258, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "キャル", 48, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 0, 80003, 259, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "コッコロ", 35, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 0, 80003, 260, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "キャル", 49, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 0, 80003, 261, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "ペコリーヌ", 43, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 0, 80003, 262, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "キャル", 50, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 0, 80003, 263, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "コッコロ", 36, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 0, 80003, 264, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "キャル", 51, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 0, 80003, 265, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "コッコロ", 37, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 0, 80003, 266, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "キャル", 52, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 0, 80003, 267, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "ペコリーヌ", 44, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 0, 80003, 268, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "コッコロ", 38, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 0, 80003, 269, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "ペコリーヌ", 45, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 0, 80003, 270, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "キャル", 53, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 0, 80003, 271, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "ペコリーヌ", 46, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 0, 80003, 272, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "カリン", 18, "こんにちは\n【ギルド管理協会】のカリンです", 0, 80003, 273, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "カリン", 19, "昨日の生放送は\nいかがだったでしょうか？", 0, 80003, 274, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "カリン", 20, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 0, 80003, 275, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "カリン", 21, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 0, 80003, 276, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "カリン", 22, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 0, 80003, 277, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "カリン", 23, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 0, 80003, 278, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "カリン", 24, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 0, 80003, 279, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "カリン", 25, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 0, 80003, 280, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "カリン", 26, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 0, 80003, 281, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "カリン", 27, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 0, 80003, 282, 190801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "ペコリーヌ", 47, "準備はいいですかっ？\n…いっきますよー！", 0, 80003, 283, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "キャル", 54, "祝！", 0, 80003, 284, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "コッコロ", 39, "2.5周年！", 0, 80003, 285, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "ペコリーヌ", 48, "おめでとうございま～す☆", 0, 80003, 286, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "キャル", 55, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 0, 80003, 287, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "コッコロ", 40, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 0, 80003, 288, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "ペコリーヌ", 49, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 0, 80003, 289, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "キャル", 56, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 0, 80003, 290, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "コッコロ", 41, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 0, 80003, 291, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "キャル", 57, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 0, 80003, 292, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "ペコリーヌ", 50, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 0, 80003, 293, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "キャル", 58, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 0, 80003, 294, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "ペコリーヌ", 51, "記念日だから\n平気平気♪\nやばいですね☆", 0, 80003, 295, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "キャル", 59, "意味分かんないわよ！", 0, 80003, 296, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "コッコロ", 42, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 0, 80003, 297, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "コッコロ", 43, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 0, 80003, 298, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "ペコリーヌ", 52, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 0, 80003, 299, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "キャル", 60, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 0, 80003, 300, 106001, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "コッコロ", 44, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 0, 80003, 301, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "ペコリーヌ", 53, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 0, 80003, 302, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "ペコリーヌ・コッコロ・キャル", 54, "2.5周年\nありがとうございます！", 0, 80003, 303, 105801, "105901,45,106001,61", 1, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "カリン", 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 60002, 304, 190804, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 1, 60002, 305, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, 60002, 306, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 1, 60002, 307, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 1, 60002, 308, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 1, 60002, 309, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 2, 60002, 310, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 2, 60002, 311, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 2, 60002, 312, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 2, 60002, 313, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2, 60002, 314, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 3, 60002, 315, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 3, 60002, 316, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 3, 60002, 317, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 3, 60002, 318, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 3, 60002, 319, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 3, 60002, 320, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 3, 60002, 321, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 4, 60002, 322, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 4, 60002, 323, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 4, 60002, 324, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 4, 60002, 325, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 4, 60002, 326, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 4, 60002, 327, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 4, 60002, 328, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 2, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 60002, 329, 190804, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "カリン", 3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, 60002, 330, 190804, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "コッコロ", 1, "ささ、シェフィさまはこちらへ…", 0, 80005, 331, 105901, "", 0, 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "シェフィ", 1, "コッコロさん、どこへ行くの…？\n…え？", 0, 80005, 332, 106401, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "ペコリーヌ", 1, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 0, 80005, 333, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "コッコロ", 2, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 0, 80005, 334, 105901, "", 0, 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "シェフィ", 2, "ええと…\n二人とも何をしているの？", 0, 80005, 335, 106401, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "キャル", 1, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 0, 80005, 336, 106001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "シェフィ", 3, "あの日…？", 0, 80005, 337, 106401, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "ペコリーヌ", 2, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 0, 80005, 338, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "ペコリーヌ", 3, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 0, 80005, 339, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "カリン", 1, "やばいですね☆", 0, 80005, 340, 190801, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "キャル", 2, "って、なにしれっと\n参加してんのよカリン！", 0, 80005, 341, 106001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "カリン", 2, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 0, 80005, 342, 190801, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "カリン", 3, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 0, 80005, 343, 190801, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "ペコリーヌ", 4, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 0, 80005, 344, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 1, "シェフィ", 4, "えっ！？　ええとええと…！\nあ、あと14日…！", 0, 80005, 345, 106401, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "ペコリーヌ", 5, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 0, 80005, 346, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "コッコロ", 3, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 0, 80005, 347, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "コッコロ", 4, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 0, 80005, 348, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "ペコリーヌ", 6, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 0, 80005, 349, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "コッコロ", 5, "さすがでございます\nペコリーヌさま", 0, 80005, 350, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "キャル", 3, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 0, 80005, 351, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "シェフィ", 5, "しゃなり、しゃなり…\nふふ、案外できるものね", 0, 80005, 352, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "ペコリーヌ", 7, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 0, 80005, 353, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "コッコロ", 6, "さ、次はキャルさまの\n番でございますよ", 0, 80005, 354, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "キャル", 4, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 0, 80005, 355, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "シェフィ", 6, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 0, 80005, 356, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "キャル", 5, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 0, 80005, 357, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "キャル", 6, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 0, 80005, 358, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "コッコロ", 7, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 0, 80005, 359, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 2, "キャル", 7, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 0, 80005, 360, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "コッコロ", 8, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 0, 80005, 361, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "ペコリーヌ", 8, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 0, 80005, 362, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "コッコロ", 9, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 0, 80005, 363, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "シェフィ", 7, "聖学祭…って、なにかしら？", 0, 80005, 364, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "コッコロ", 10, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 0, 80005, 365, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "キャル", 8, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 0, 80005, 366, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "キャル", 9, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 0, 80005, 367, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "ペコリーヌ", 9, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 0, 80005, 368, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "キャル", 10, "いや、そのまんますぎでしょ…", 0, 80005, 369, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "シェフィ", 8, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 0, 80005, 370, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "ペコリーヌ", 10, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 0, 80005, 371, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 3, "シェフィ", 9, "えっ？　ええ…\nぎゅーっ…？", 0, 80005, 372, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "キャル", 11, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 0, 80005, 373, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "シェフィ", 10, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 0, 80005, 374, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "キャル", 12, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 0, 80005, 375, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "コッコロ", 11, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 0, 80005, 376, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "キャル", 13, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 0, 80005, 377, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "ペコリーヌ", 11, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 0, 80005, 378, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "キャル", 14, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 0, 80005, 379, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "キャル", 15, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 0, 80005, 380, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "シェフィ", 11, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 0, 80005, 381, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "ペコリーヌ", 12, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 0, 80005, 382, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "コッコロ", 12, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 0, 80005, 383, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "キャル", 16, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 0, 80005, 384, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 4, "シェフィ", 12, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 0, 80005, 385, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "ペコリーヌ", 13, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 0, 80005, 386, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "ペコリーヌ", 14, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 0, 80005, 387, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "ペコリーヌ", 15, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 0, 80005, 388, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "キャル", 17, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 0, 80005, 389, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "キャル", 18, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 0, 80005, 390, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "シェフィ", 13, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 0, 80005, 391, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "コッコロ", 13, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 0, 80005, 392, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "ペコリーヌ", 16, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 0, 80005, 393, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "キャル", 19, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 0, 80005, 394, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "ペコリーヌ", 17, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 0, 80005, 395, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "ペコリーヌ", 18, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 0, 80005, 396, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 5, "ペコリーヌ", 19, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 0, 80005, 397, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "カリン", 4, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 0, 80005, 398, 190801, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "カリン", 5, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 0, 80005, 399, 190801, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "キャル", 20, "…えっ！？", 0, 80005, 400, 106001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "ペコリーヌ", 20, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 0, 80005, 401, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "シェフィ", 14, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 0, 80005, 402, 106401, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "コッコロ", 14, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 0, 80005, 403, 105901, "", 0, 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "シェフィ", 15, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 0, 80005, 404, 106401, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "キャル", 21, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 0, 80005, 405, 106001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "ペコリーヌ", 21, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 0, 80005, 406, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "キャル", 22, "ぶっ殺すぞ！？", 0, 80005, 407, 106001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 6, "カリン", 6, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 0, 80005, 408, 190801, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "コッコロ", 15, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 0, 80005, 409, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "キャル", 23, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 0, 80005, 410, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "シェフィ", 16, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 0, 80005, 411, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "ペコリーヌ", 22, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 0, 80005, 412, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "キャル", 24, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 0, 80005, 413, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "シェフィ", 17, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 0, 80005, 414, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "コッコロ", 16, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 0, 80005, 415, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "シェフィ", 18, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 0, 80005, 416, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "コッコロ", 17, "もちろんでございます\n仲良くお勉強いたしましょう", 0, 80005, 417, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "キャル", 25, "しれっと教育ママが\n生まれてる…？", 0, 80005, 418, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "ペコリーヌ", 23, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 0, 80005, 419, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "キャル", 26, "え～～～～！？", 0, 80005, 420, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "キャル", 27, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 0, 80005, 421, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "シェフィ", 19, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 0, 80005, 422, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "コッコロ", 18, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 0, 80005, 423, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "ペコリーヌ", 24, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 0, 80005, 424, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "シェフィ", 20, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 0, 80005, 425, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "キャル", 28, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 0, 80005, 426, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "コッコロ", 19, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 0, 80005, 427, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "シェフィ", 21, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 0, 80005, 428, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "キャル", 29, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 0, 80005, 429, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "キャル", 30, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 0, 80005, 430, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "ペコリーヌ", 25, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 0, 80005, 431, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 8, "キャル", 31, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 0, 80005, 432, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "シェフィ", 22, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 0, 80005, 433, 106401, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "シェフィ", 23, "…えっ？\n生放送の意気込み！？\n突然なに！？", 0, 80005, 434, 106401, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "シェフィ", 24, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 0, 80005, 435, 106401, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "シェフィ", 25, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 0, 80005, 436, 106401, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "シェフィ", 26, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 0, 80005, 437, 106401, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "シェフィ", 27, "それから、それから…！\nぅ、ぅぅっ…！", 0, 80005, 438, 106401, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "シェフィ", 28, "―びえぇぇ～んっ！！！", 0, 80005, 439, 106401, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "コッコロ", 20, "どうされましたか、シェフィさま", 0, 80005, 440, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "シェフィ", 29, "ううっ…ひっく…\nママッ…！", 0, 80005, 441, 106401, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "コッコロ", 21, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 0, 80005, 442, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "コッコロ", 22, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 0, 80005, 443, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 9, "シェフィ", 30, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 0, 80005, 444, 106401, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "コッコロ", 23, "主さま\n3.5周年まであと５日\nでございます", 0, 80005, 445, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "コッコロ", 24, "ですがその前に\n生放送がありますね", 0, 80005, 446, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "コッコロ", 25, "…生放送に向けた\n意気込みでございますか？", 0, 80005, 447, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "コッコロ", 26, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 0, 80005, 448, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "コッコロ", 27, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 0, 80005, 449, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "コッコロ", 28, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 0, 80005, 450, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "コッコロ", 29, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 0, 80005, 451, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "コッコロ", 30, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 0, 80005, 452, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 10, "コッコロ", 31, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 0, 80005, 453, 105901, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "ペコリーヌ", 26, "3.5周年まであと４日！\nやばいですね☆", 0, 80005, 454, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "キャル", 32, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 0, 80005, 455, 106001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "ペコリーヌ", 27, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 0, 80005, 456, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "ペコリーヌ", 28, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 0, 80005, 457, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "ペコリーヌ", 29, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 0, 80005, 458, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "キャル", 33, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 0, 80005, 459, 106001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "ペコリーヌ", 30, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 0, 80005, 460, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "ペコリーヌ", 31, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 0, 80005, 461, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "ペコリーヌ", 32, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 0, 80005, 462, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "キャル", 34, "だからあたしはやるなんて一言も…", 0, 80005, 463, 106001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "ペコリーヌ", 33, "オイッスー☆", 0, 80005, 464, 105801, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 11, "キャル", 35, "聞きなさいっての！！", 0, 80005, 465, 106001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "シェフィ", 31, "3.5周年まであと３日…\nそして生放送は、明日…", 0, 80005, 466, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "シェフィ", 32, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 0, 80005, 467, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "シェフィ", 33, "おいっす！\n…こうじゃなかったわね\nええと確か…", 0, 80005, 468, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "シェフィ", 34, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 0, 80005, 469, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "シェフィ", 35, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 0, 80005, 470, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "ペコリーヌ", 34, "やってますねシェフィちゃん！", 0, 80005, 471, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "キャル", 36, "なによ、考えることは\nみんな同じってこと？", 0, 80005, 472, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "コッコロ", 32, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 0, 80005, 473, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "シェフィ", 36, "みんな…もちろんよ！", 0, 80005, 474, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 12, "ペコリーヌ", 35, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 0, 80005, 475, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "カリン", 7, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 0, 80005, 476, 190801, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "カリン", 8, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 0, 80005, 477, 190801, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "ペコリーヌ", 36, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 0, 80005, 478, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "カリン", 9, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 0, 80005, 479, 190801, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "コッコロ", 33, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 0, 80005, 480, 105901, "", 0, 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "カリン", 10, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 0, 80005, 481, 190801, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "キャル", 37, "大丈夫…大丈夫…\nあたしは大丈夫…", 0, 80005, 482, 106001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "カリン", 11, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 0, 80005, 483, 190801, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "シェフィ", 37, "あうー？", 0, 80005, 484, 106401, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "みんな", 37, "あ…", 0, 80005, 485, 105801, "105901,34,106001,38,190801,12", 1, 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "キャル", 39, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 0, 80005, 486, 106001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "コッコロ", 35, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 0, 80005, 487, 105901, "", 0, 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "ペコリーヌ", 38, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 0, 80005, 488, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 13, "カリン", 13, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 0, 80005, 489, 190801, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "シェフィ", 38, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 0, 80005, 490, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "ペコリーヌ", 39, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 0, 80005, 491, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "キャル", 40, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 0, 80005, 492, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "コッコロ", 36, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 0, 80005, 493, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "シェフィ", 39, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 0, 80005, 494, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "ペコリーヌ", 40, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 0, 80005, 495, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "コッコロ", 37, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 0, 80005, 496, 105901, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "キャル", 41, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 0, 80005, 497, 106001, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "シェフィ", 40, "へ、へぇ…", 0, 80005, 498, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "ペコリーヌ", 41, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 0, 80005, 499, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "シェフィ", 41, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 0, 80005, 500, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 14, "シェフィ", 42, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 0, 80005, 501, 106401, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "ペコリーヌ", 42, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 0, 80005, 502, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "キャル", 42, "祝！", 0, 80005, 503, 106001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "コッコロ", 38, "3.5周年！", 0, 80005, 504, 105901, "", 0, 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "シェフィ", 43, "おめでとうございます！", 0, 80005, 505, 106401, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "カリン", 14, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 0, 80005, 506, 190801, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "カリン", 15, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 0, 80005, 507, 190801, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "ペコリーヌ", 43, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 0, 80005, 508, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "ペコリーヌ", 44, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 0, 80005, 509, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "キャル", 43, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 0, 80005, 510, 106001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "キャル", 44, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 0, 80005, 511, 106001, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "シェフィ", 44, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 0, 80005, 512, 106401, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "シェフィ", 45, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 0, 80005, 513, 106401, "", 0, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "コッコロ", 39, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 0, 80005, 514, 105901, "", 0, 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "コッコロ", 40, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 0, 80005, 515, 105901, "", 0, 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "コッコロ", 41, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 0, 80005, 516, 105901, "", 0, 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "ペコリーヌ", 45, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 0, 80005, 517, 105801, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 15, "みんな", 46, "これからも\nよろしくおねがいします！", 0, 80005, 518, 105801, "105901,42,106001,45,106401,46,190801,16", 1, 4);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "カリン", 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 60003, 519, 190804, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 1, 60003, 520, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, 60003, 521, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 1, 60003, 522, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 1, 60003, 523, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 1, 60003, 524, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 2, 60003, 525, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 2, 60003, 526, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 2, 60003, 527, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 2, 60003, 528, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2, 60003, 529, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 3, 60003, 530, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 3, 60003, 531, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 3, 60003, 532, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 3, 60003, 533, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 3, 60003, 534, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 3, 60003, 535, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 3, 60003, 536, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 4, 60003, 537, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 4, 60003, 538, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 4, 60003, 539, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 4, 60003, 540, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 4, 60003, 541, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 4, 60003, 542, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 0, "", 0, "今日の運勢は小吉！　無理は禁物、お家で静かにしていましょう　プロぼっちの私が、お家での過ごし方……教えてあげましょうか？", 4, 60003, 543, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 0, "カリン", 2, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 60003, 544, 190804, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, 7, "カリン", 3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, 60003, 545, 190804, "", 0, 3);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "カリン", 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 60004, 546, 190804, "", 0, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, 60004, 547, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 1, 60004, 548, 0, "", 0, 2);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, "", 0, "今日の運勢は姫吉！　宴でも開きたくなるほどの絶対幸運！\nイメチェンでもしてみるのはどうだ？　ぴょんぴょん、なんてな♪", 1, 60004, 549, 0, "", 0, 2);
